// Setter
func setUserDefaults(value: Any, forKey key: String) {
    UserDefaults.standard.set(value, forKey: key)
}

// Getter
func getUserDefaults(forKey key: String) -> Any? {
    return UserDefaults.standard.object(forKey: key)
}
// END GENAI@CHATGPT4
```

In the setter method, you pass the value you want to store and the key under which you want to store it. In the getter method, you pass the key of the value you want to retrieve. The getter method returns an Optional because there might not be any value stored under the provided key.

